import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            <Banner
                pageTitle={'Blogs.'}
                subtitle={'Here is Some of my blogs that i have made '}
            />
            <br />
            <Link to={'/blogs'}>
                Blogs
            </Link>
            <br />
            <Link to={'/contacts'}>
                Contacts
            </Link>
        </div>
    );
}

export default Home;
